function isActive(pageInfo) {
  return pageInfo.active;
}
function renderGallery() {
  let galleryHTML = "";
  for (let i = 0; i < PageGContents.length; i++) {
    let PageGContent = PageGContents[i];
    let PageInfo = PageGContent[0];
    if (isActive(PageInfo)) {
      itemActive = i;
      galleryHTML += `<div class="albums active">${needContainer(
        PageInfo
      )}<img class="background" src="../images/Gallerypage/background.png" /> <div class="content">${renderGalleryElements(
        PageGContent
      )}</div></div> `;
    } else {
      galleryHTML += `<div class="albums">${needContainer(
        PageInfo
      )}<img class="background" src="../images/Gallerypage/background.png" /> <div class="content">${renderGalleryElements(
        PageGContent
      )}</div></div> `;
    }
  }
  document.querySelector(".list").innerHTML = galleryHTML;
}
function renderGalleryElements(albums) {
  let GalleryElementsHTML = "";
  for (let j = 1; j < albums.length; j++) {
    let album = albums[j];
    GalleryElementsHTML += `<div class="album${j + 1} album">
                <a href="Albumpage.html?albumId=${album.id}" class="link">
                  <div class="frame">
                    <img
                      src="../images/Gallerypage/${album.albumCover}"
                      class="albumcover"
                    />
                  </div>
                </a>
                <div class="description">
                  <div class="date">${album.date}</div>
                  <div class="title">${album.title}</div>
                </div>
              </div>`;
  }
  return GalleryElementsHTML;
}
function renderGallerypage() {
  renderHeader2("gallery");
  renderGallery();
  pageAnimation();
}
renderGallerypage();
